import React from 'react';
import { Wrapper, StyledPopup, CloseButton } from './styles';

const Popup: React.FC = ({ children }) => {
  return (
    <Wrapper>
      <StyledPopup>
        <CloseButton />
        {children}
      </StyledPopup>
    </Wrapper>
  )
}

export default Popup;
